import React from 'react';
const App = () =>{
return(
  <>
    <div className="main_div">
      <div className='center_div'>
        <br/>
        <h1>To Do List</h1>
        <br/>
        <input type="text" placeholder='add name'/>
        <button className='but_sty'>+</button>
        <ol>
          <li>
            Buy a Apple
          </li>
        </ol>
      </div>
    </div>
  </>
)
};
export default App;
